import React from "react";
import './style.css';

const Recipes = ({ children, subtitle, image }) => {
  return (
    <div>
      <div>
        <h2>{ children }</h2>
      </div>
      <div className="recipes">
        <h3>{ subtitle }</h3>
        <img src={ image } alt="" />
      </div>
    </div>
  )
}

export default Recipes;
